import { Table } from 'antd';
import React from 'react'

const columns = [
    {
        title: 'Parameter',
        dataIndex: 'Label',
    },
    {
        title: 'PV',
        dataIndex: 'Value',
    },
    {
        title: 'SV',
        dataIndex: 'SV',
    },
    {
        title: 'Update Time',
        dataIndex: 'time',
    },
];


const RealTimeTableWrapper = (props) => {

    let TableData = props.TableData

    console.log(props.TableData);

    return (
        <div>
            <Table title={props.TableTitle} bordered columns={columns} dataSource={TableData} size="small" pagination={8}/>
        </div>
    )
}

export default RealTimeTableWrapper


